using namespace std;
int SIZE=100000;
vector<int>V;
int lower(int a){
    int lb=-1,ub=V.size();
    while(ub-lb>1){
        int mid=(lb+ub)/2;
        if(V[mid]>a){
            ub=mid;
        }else{
            lb=mid;
        }
    }
    return ub-1;
}
int main(){
    bool prime[SIZE+1];
    memset(prime,true,sizeof(prime));
    for(int i=2;i<=SIZE;i++){
        if(prime[i])for(int j=i*2;j<=SIZE;j+=i)prime[j]=false;
    }
    int m,a,b;
    for(int i=2;i<=SIZE;i++)if(prime[i])V.push_back(i);
    while(1){
        pair<int,int> ans;
        ans=MP(-1,1);
        cin>>m>>a>>b;
        if(m+a+b==0)break;
        REP(i,V.size()){
            int p=V[i];
            if(m/p<=1)break;
            int qq=lower(m/p);
            while((p*b<a*V[qq]||p>V[qq])&&qq>0)qq--;
            int q=V[qq];
            if(p*b<a*q||p>q)continue;
            if(ans.fir*ans.sec<p*q){
                ans=MP(p,q);
            }
        }
        cout<<ans.fir<<" "<<ans.sec<<endl;
    }
}

