const int N_MAX = 1e5 + 10;
bool is_prime[N_MAX];

// エラトステネスのふるい
void Eratosthenes(){
    FOR(i, 0, N_MAX){
        is_prime[i] = true;
    }
    is_prime[0] = false;
    is_prime[1] = false;
    for(ll i=2; i*i<=N_MAX; i++){
        if(is_prime[i]){
            int p = i;
            int step_p = p;
            // それの倍数を消していく
            while(p < N_MAX){
                p += step_p;
                if(p<N_MAX){
                    is_prime[p] = 0;
                }
            }
        }
    }
}

int main(){
    cin.tie(0);
    ios::sync_with_stdio(false);

    // input
    ll m, a, b;

    Eratosthenes();

    while(cin>>m>>a>>b){
      if(m==0&&a==0&&b==0) return 0;

      ll ma = -1;
      pair<ll, ll> ans;
      FOR(p, 2, 100000){
        if(!is_prime[p]) continue;
        for(int q=p; p*q<=m && p<=q; q++){
          if(!is_prime[q]) continue;
          if(a*q<=p*b){
            if(p*q > ma){
              ans = make_pair(p, q);
              ma = p*q;
            }
          }
        }
      }
      p2(ans.first, ans.second);
    }

    return 0;
}

