            if (!is_prime[(int)p]) continue;
            for (double q=2; q<=m; ++q) {
                if (!is_prime[(int)q]) continue;
                if (a/b > p/q or p/q > 1.0) continue;
                if (p*q > m) continue;
                if (best < p*q) {
                    best = p*q;
                    P = p;
                    Q = q;
                }
            }
        }
        cout << P << ' ' << Q << endl;
    }
    return 0;
}

