#define maxnum 100000

struct suc{
	int d;
	struct suc *next;
};

int main(void){
	int flag[maxnum + 1], i, j, m, a, b, k, l, S;
	memset(flag,-1,sizeof(flag));
	struct suc s, *p, *q;
	flag[0] = flag[1] = 0;
	for(i = 2;i <= sqrt((double)maxnum);i++){
		for(j = 2 * i;j <= maxnum;j+=i)
			flag[j] = 0;
	}
	p = &s;
	for(i = 0;i <= maxnum;i++){
		if(flag[i]){
			p->next = (struct suc *)malloc(sizeof(struct suc));
			p->d = i;
			p = p->next;
		}
	}
	p->next = NULL;
	while(1){
		scanf("%d%d%d",&m,&a,&b);
		if(m == 0 && a == 0 && b == 0)
			break;
		S = 0;
		for(p = &s;p->next != NULL && p->d <= m;p=p->next){
			for(q = p;q->next != NULL && p->d * q->d <= m;q=q->next){
				if((double)a/b <= (double)p->d/q->d && S < p->d * q->d){
					k = p->d;
					l = q->d;
					S = k * l;
				}
			}
		}
		printf("%d %d\n",k,l);
	}
	return 0;
}

