const int N = 1000;
const double EPS = 1e-5;

int m, a, b, aw, ah;
vector<int> prime;
bool is_prime[N+1];

void sieve(){
  fill(is_prime, is_prime+N+1, true);
  is_prime[0] = is_prime[1] = false;
  for(int i=2;i<=N;i++){
    if(is_prime[i]){
      prime.push_back(i);
      for(int j=2*i;j<=N;j+=i) is_prime[j] = false;
    }
  }
}

bool equal(double a, double b){
  return abs(a-b) < EPS;
}

void solve(){
  int w, h;
  for(int i=0;i<prime.size();i++){
    w = prime[i];
    if(w > m) break;
    for(int j=i;j<prime.size();j++){
      h = prime[j];
      if(w * h > m) break;
      double tmp1 = (double)a / b;
      double tmp2 = (double)w / h;
      if((tmp1 < tmp2 || equal(tmp1, tmp2)) && w * h <= m){
        if(aw * ah > m || w * h > aw * ah){
          aw = w;
          ah = h;
        }
      }
    }
  }
}

main(){
  sieve();
  while(cin >> m >> a >> b && (m|a|b)){
    aw = a;
    ah = b;
    solve();
    cout << aw << ' ' << ah << endl;
  }
}

