#include <iostream>
#include <algorithm>
#include <vector>
using namespace std;

struct data{
  int pq, p, q;
};

bool comp(const data &a, const data &b)
{
  return a.pq > b.pq;
}

const int MAX_N = 50000;
bool prime[MAX_N+1];

void sieve()
{
  fill(prime, prime+MAX_N+1, true);
  prime[0] = prime[1] = false;
  for(int i = 2; i <= MAX_N; i++)
    if(prime[i])
      for(int j = i*2; j <= MAX_N; j += i)
        prime[j] = false;
}

int main()
{
  sieve();
  while(1){
    int m, a, b;
    cin >> m >> a >> b;
    if(m == 0 && a == 0 && b == 0) break;
    vector<data> v;
    for(int i = 2; i <= MAX_N; i++){
      if(prime[i]){
        for(int j = i; j <= MAX_N; j++){
          if(prime[j]){
            int y = i*j;
            if(y > m)
              break;
            if(a*j <= b*i){
              struct data d;
              d.pq = y;
              d.p = i;
              d.q = j;
              v.push_back(d);
            } 
          }
        }
      }
    }
    sort(v.begin(),v.end(),comp);
    cout << v[0].p << " " << v[0].q << endl;
  }
}

