			for(int a = 0; a < 16; a++){
				for(int c = 0; c < 16; c++){
					int cnt[257] = {};
					int maxo = 0;
					for(int j = 1; j < n + 1; j++){
						int o = (i[j] + r[s][a][c][j]) % 256;
						cnt[o]++;
						maxo = max(maxo, o);
					}
					double h = 0;
					for(int i = 0; i < maxo + 1; i++){
						if(cnt[i] != 0){
							h -= cnt[i] * log(cnt[i]);
						}
					}
					// h = h / n;
					// h += log(n);
					// cout << s << " " << a << " " << c << " " << h << endl;
					if(h < minh){
						ans_s = s;
						ans_a = a;
						ans_c = c;
						minh = h;
					}
				}
			}
		}
		cout << ans_s << " " << ans_a << " " << ans_c << endl;
	}
	return 0;
}

