    uint32_t max_p = 0;
    uint32_t max_q = 0;
    for (uint32_t i = 0; i < primes.size(); i++) {
      for (uint32_t j = i; j < primes.size(); j++) {
        uint32_t p = primes[i];
        uint32_t q = primes[j];
        if (p * q <= m && a * q <= b * p) {
          if (max_p * max_q < p * q) {
            max_p = p;
            max_q = q;
          }
        }
      }
    }

    cout << max_p << " " << max_q << endl;
  }

  return 0;
}

