// n以下の素数の数を返す
i64 sieve(i64 n) {
    i64 p = 0;
    for (i64 i = 0; i <= n; i++)
        is_prime[i] = true;
    is_prime[0] = false;
    is_prime[1] = false;
    for (i64 i = 2; i <= n; i++) {
        if (is_prime[i]) {
            prime[p++] = i;
            for (i64 j = 2 * i; j <= n; j += i)
                is_prime[j] = false;
        }
    }
    return p;
}

int main(){
    int n = sieve(100000);
    int m, a, b;
    while(cin >> m >> a >> b, m > 0){
        int max_area = 0, max_p = 0, max_q = 0;
        for(int i=0, q=prime[i];i<n&&q<=m;q=prime[++i]){
            for(int j=0, p=prime[j];j<n&&p*q<=m;p=prime[++j]){
                if(b*p < a*q)continue;
                if(b*p > b*q)break;
                if(p*q > max_area){
                    max_area = p*q;
                    max_p = p;
                    max_q = q;
                }
            }
        }
        cout << max_p << " " << max_q << endl;
