	for(int i = 2; i < MAX_PRIME; ++i){
		if(sieve[i]){ continue; }
		primes.push_back(i);
		for(int j = i + i; j < MAX_PRIME; j += i){ sieve[j] = true; }
	}
	while(true){
		int m, a, b;
		cin >> m >> a >> b;
		if(m == 0 && a == 0 && b == 0){ break; }
		int c = 0, d = 0;
		for(int i = 0; i < primes.size(); ++i){
			int deno = primes[i];
			int upper = std::min(m / deno, deno);
			vector<int>::iterator it = upper_bound(
				primes.begin(), primes.end(), upper);
			if(it != primes.begin()){
				--it;
				if(a * deno > b * (*it)){ continue; }
				if(c * d < *it * deno){
					c = *it;
					d = deno;
				}
			}
		}
		cout << min(c, d) << " " << max(c, d) << endl;
	}
	return 0;
}

