pii solve(int m,int a,int b){
	// a/b<=p/q aq<=pb
	// p/q<=1 p<=q
	ll cmax=0;
	pii res;
	for(int mm=4;mm<=m;++mm){
		if(isprime[mm])
			continue;
		for(int p=2;p*p<=mm;++p){
			if(mm%p==0){
				int q=mm/p;
				if(isprime[p]&&isprime[q]){
					if(p<=q&&a*q<=p*b&&mm>cmax){
						cmax=mm;
						res=mp(p,q);
					}
				}
			}
		}
	}
	return res;
}

int main(void){
	init();
	int m,a,b;
	while(cin >> m >> a >> b){
		if(m==0)
			break;
		pii ans=solve(m,a,b);
		cout << ans.first << " " << ans.second << endl;
	}
	return 0;
}

