int SIZE=1e5;
int main(){
    int prime[SIZE+1];
    vector<int>V;
    memset(prime,1,sizeof(prime));
    prime[0]=prime[1]=0;
    REP(i,SIZE+1){
        if(prime[i]){
            for(int j=i*2;j<=SIZE;j+=i)prime[j]=0;
            V.PB(i);
        }
    }
    REP(i,SIZE){
        if(prime[i+1])prime[i+1]=i+1;
        else prime[i+1]=prime[i];
    }
    while(1){
        int m,a,b;
        cin>>m>>a>>b;
