int judge(int n)
{
  if(n<2)return 0;
  if(n==2)return 1;
  if(n%2==0)return 0;
  for(int i=3;i<n/i;i+=3){
    if(n%i==0)return 0;
  }
  return 1;
}
int main()
{
  int m,a,b,prime[100000],n=0,p,q;
  double ab;
  for(int i=0;i<100000;i++){
    if(judge(i))prime[n++]=i;
  }
  while(1){
    cin>>m>>a>>b;
    if(m==0&&a==0&&b==0)break;
    ab=(double)a/b;
    p=1;q=1;
    for(int i=0;i<n;i++){
      for(int j=i;prime[i]*prime[j]<=m;j++){
	if(prime[i]*prime[j]>p*q && ab <=(double)prime[i]/prime[j]){
	  p=prime[i];
	  q=prime[j];
	}
      }
    }
    cout<<p<<" "<<q<<endl;
  }
  return 0;
}

