std::array<bool, 200001> prime_list(int n){
  std::array<bool, 200001> is_prime = {};
  for(int i=0; i<200001; i++) is_prime[i] = true;

  is_prime[0] = false;
  is_prime[1] = false;

  for(int i=2; i <= std::sqrt(n)+1 ; i++){
    if(!is_prime[i]){
      continue;
    }
    for(int j=i+i; j<n+1; j=j+i){
      is_prime[j] = false;
    }
  }
  return is_prime;
}

void solve(int m, int a, int b, std::array<bool, 200001> primes){
  int max = 0;
  int p = 0; int q = 0;

  for(int i=1; i*i<=m; i++){
    for(int j=i; j<=b*i/a; j++){
      if(j<=100001){
        //std::cout << i << " " << primes[i] << " " << j << primes[j] << std::endl;
        if (primes[i]*primes[j]==1 && max < i*j && i*j <=m){
          p = i; q = j;
          max = i*j;
        }
      }
    }
  }
  std::cout << p << " " << q << std::endl;
  return;
}

