    std::array<bool, 200001> primes = prime_list(200001);
    while(1){
      int m, a, b;
      std::cin >> m >> a >>b;
      if(m+a+b == 0){
        break;
      }
      solve(m, a, b, primes);
    }
  return 0;
}

