      uint32_t p = primes[i];
      if (p > m) continue;
      for (uint32_t j = i; j < primes.size(); j++) {
        uint32_t q = primes[j];
        if (p * q <= m && a * q <= b * p) {
          if (max_p * max_q < p * q) {
            max_p = p;
            max_q = q;
          }
        }
      }
    }

