bool is_prime[N+1];

void sieve(){
  fill(is_prime, is_prime+N+1, true);
  is_prime[0] = is_prime[1] = false;
  for(int i=2;i<=N;i++){
    if(is_prime[i]){
      prime.push_back(i);
      for(int j=2*i;j<=N;j+=i) is_prime[j] = false;
    }
  }
}

bool equal(double a, double b){
  return abs(a-b) < EPS;
}

void solve(){
  int w, h;
  for(int i=0;i<prime.size();i++){
    w = prime[i];
    if(w > m) break;
    for(int j=i;j<prime.size();j++){
      h = prime[j];
      if(w * h > m) break;
      double tmp1 = (double)a / b;
      double tmp2 = (double)w / h;
      if((tmp1 < tmp2 || equal(tmp1, tmp2)) && (tmp2 < 1.0 || equal(tmp2, 1.0)) && w * h <= m){
        if(w * h > aw * ah){
          aw = w;
          ah = h;
        }
      }
    }
  }
}

main(){
  sieve();
  while(cin >> m >> a >> b && (m|a|b)){
    aw = 1;
    ah = 1;
    solve();
    cout << aw << ' ' << ah << endl;
  }
}

