        it = upper_bound(plst.begin(),plst.end(),m/nowq);
        if(it != plst.begin())
            righ = min(righ,*(--it));
        else righ = 0;
        if(righ >= lef && p * q < nowq * righ)p = righ, q = nowq;
    }
