        int P = -1, Q = -1;
        int ma = 0;
        for (int q = 2; q <= m; ++q) if (table[q]) {
            for (int p = 2; p <= q && p * q <= m; ++p) if (table[p]) {
                if (a * q > b * p) {
                    continue;
                }

                if (chmax(ma, p * q)) {
                    P = p, Q = q;
                }
            }
        }

        cout << P << " " << Q << endl;
    }

    return 0;
}

