void solve(int a, int b, int m, int p, int q, int &pq_max, int &p_max, int &q_max){
  if(p * q <= m && a / (double)b <= p / (double)q && p / (double)q <= 1.0){
    if(pq_max < p * q){
      pq_max = p * q;
      p_max = p;
      q_max = q;
    }
  }
}

int main(void){
  primefy();
  vector<int> prime_list;
  int cnt = 0;
