      cnt++;
    }
  }

  int m, a, b;
  while(cin >> m >> a >> b, m | a | b){
    int p_max, q_max, pq_max;
    p_max = q_max = pq_max = 0;
    for(int i=0; i < cnt; i++){
      for(int j=i; j < cnt; j++){
	int p = prime_list[i];
	int q = prime_list[j];
	solve(a, b, m, p, q, pq_max, p_max, q_max);
      }
    }
    cout << p_max << " " << q_max << endl;
  }

