    is_prime[0] = false;

    for(int i=0; i<n; i++){
        if(is_prime[i]){
            primes.push_back(i+1);
            for(int j=2*i+1; j<n; j+=i+1)
                is_prime[j] = false;
        }
    }
    return primes;
}

int main(){
