            // i < j, primes[i] < primes[j]
            ll pi = primes[i];
            ll pj = primes[j];
            if(pi * pj < MAX_M){
                pair<int, int> &p = table[pi*pj];
                if(p.first == 0 || p.first*pj < p.second*pi){
                    p.first = pi;
                    p.second = pj;
                }

            }else{
