const static int M_MAX = 999999;

int main() {
  int era[ M_MAX + 1 ] = { 0 };
  int backNear[ M_MAX + 1 ];
  int curBack = -9999;

  vector<int> primes;
  era[ 0 ] = era[ 1 ] = 1;
  for( int i = 2; i <= M_MAX; i++ ) {
    backNear[ i ] = curBack;
    if( era[ i ] ) { continue; }
    curBack = i;
    backNear[ i ] = curBack;
    primes.push_back( i );
    for( int j = i + i; j <= M_MAX; j += i ) {
      era[ j ] = 1; 
    }
  }
  int pLen = primes.size();

  while( 1 ) {
    int m, a, b;
    cin >> m >> a >> b;
    if( !m && !a && !b ) { return EXIT_SUCCESS; }

    int ansP = -1, ansQ = -1;
    for( int i = 0; primes[ i ] <= backNear[ m / primes[ i ] ]; i++ ) {
      int p = primes[ i ];
      int q = backNear[ m / p ];
      if( a * q <= b * p ) { 
        if( ansP == -1 || p * q > ansP * ansQ ) {
          ansP = p;
          ansQ = q;
        }
      }
      if( q > 2 ) {
        q = backNear[ q - 1 ];
        if( a * q <= b * p ) { 
          if( ansP == -1 || p * q > ansP * ansQ ) {
            ansP = p;
            ansQ = q;
          }
        }
      }
    }
    cout << ansP << " " << ansQ << endl;
  }
}

