vector<int> primes(int n) {
  vector<int> p(n+1, 1);
  for (int i = 2; i*i <= n; ++i)
    if (p[i])
      for (int j = i*i; j <= n; j += i)
        p[j] = 0;
  vector<int> res;
  for (int i = 2; i <= n; ++i)
    if (p[i])
      res.push_back(i);
  return res;
}

int main() {
  auto pl = primes(1000000);
  int n = pl.size();
  while(1){
    int m,a,b;
    cin>>m>>a>>b;
    if(!m)break;
    int sp,sq,st=0;
    REP(i,n) {
      REP(j,i+1) {
        int p=pl[j],q=pl[i];
        if (p*q > m) break;
        if (a*q > b*p) continue;
        if (p*q > st) {
          st = p*q;
          sp=p;sq=q;
        }
      }
    }
    cout << sp << ' ' << sq << endl;
  }
  return 0;
}

