using namespace std;

constexpr int lim = 100000;
char isprime[lim];
int prime[lim];
int ind = 0;

void set_prime() {
    fill(isprime, isprime + lim, 1);
    isprime[0] = isprime[1] = 0;

    for (int x = 2; x < lim; ++x) {
        if (!isprime[x]) continue;
        prime[ind++] = x;

        if (x * 2 >= lim) continue;
        for (int y = x * 2; y <  lim; y += x) {
            isprime[y] = 0;
        }
    }
}

pair<int, int> solve(const int& m, const int& a, const int& b) {
    int max_pq = 0;
    pair<int, int> ret;
    for (int j = 0; j < ind && prime[j] < m; ++j) {
        int q = prime[j];

        int* lb = lower_bound(prime, prime + ind, (double)a * q / b);

        int p = *(upper_bound(prime, prime + ind, min(q, m / q)) - 1);

        if(*lb <= p && p * q > max_pq) {
            max_pq = p * q;

            ret = make_pair(p, q);
        }
    }

    return ret;
}

int main() {
    set_prime();

    int m, a, b;
    while (true) {
        cin >> m;
        cin >> a;
        cin >> b;

        if(m == 0) break;
        pair<int, int> ret = solve(m, a, b);
        cout << ret.first << ' ' << ret.second << endl;
    }
    return 0;
}

