void createPrimeTable(vector<int> &table, int maxNum)
{
	vector<bool> isPrime(maxNum + 1, true);

	isPrime[0] = isPrime[1] = false;

	for(int i = 2; i <= maxNum; ++i) {
		if(!isPrime[i])
			continue;
		for(int j = i * 2; j <= maxNum; j += i)
			isPrime[j] = false;
	}

	table.resize(0);
	table.reserve(sqrt(maxNum));
	for(int i = 0; i < maxNum + 1; ++i) {
		if(isPrime[i])
			table.push_back(i);
	}
}

