			break;

		int pa = 0, qa = 0;

		for(int pidx = 0; prime[pidx] * prime[pidx] <= m; ++pidx) {

			int p = prime[pidx];

			int ub = prime.size() - 1;
			int lb = 0;

			// p * q <= m
			ub = min(ub, upperIdx(prime, m / p) - 1);

			// p / q <= 1
			lb = max(lb, pidx);

			// a / b <= p / q (q <= pb/a)
			ub = min(ub, upperIdx(prime, p * b / a) - 1);

			if(lb <= ub) {

