bool is_prime(uint32_t n)
{
  for (uint32_t i = 2; i <= (uint32_t)sqrt(n); i++) {
    if (n % i == 0) {
      return false;
    }
  }
  return true;
}

vector<uint32_t> primes_up_to(uint32_t n)
{
  vector<uint32_t> primes;
  for (uint32_t i = 2; i <= n; i++) {
    if (is_prime(i)) {
      primes.push_back(i);
    }
  }

  return primes;
}

