struct data{
  int pq, p, q;
  double pdq;
};

bool comp(const data &a, const data &b)
{
  return a.pq > b.pq;
}

const int MAX_N = 50000;
bool prime[MAX_N+1];
vector<data> v;

void sieve()
{
  fill(prime, prime+MAX_N+1, true);
  prime[0] = prime[1] = false;
  for(int i = 2; i <= MAX_N; i++)
    if(prime[i])
      for(int j = i*2; j <= MAX_N; j += i)
        prime[j] = false;
  struct data x;
  for(int i = 2; i < MAX_N; i++)
    for(int j = i; j < MAX_N; j++)
      if(prime[i] && prime[j]){
        x.pq = i*j;
        x.p = i;
        x.q = j;
        x.pdq = i / j;
        v.push_back(x);
      }
  sort(v.begin(),v.end(),comp);
}

int main()
{
  sieve();
  while(1){
    int m, a, b;
    cin >> m >> a >> b;
    if(m == 0 && a == 0 && b == 0) break;
    double x = a / b;
    for(int i = 0; i < (int)v.size(); i++)
      if(v[i].pq <= m && x <= v[i].pdq){
        cout << v[i].p << " " << v[i].q << endl;
        break;
      }
  }
}

