const int MAX_NUM = 10000;
vector<int> prime;

void init_prime()
{
    bool tmp_prime[MAX_NUM + 1];

    for (int i = 0; i <= MAX_NUM; i++)
        tmp_prime[i] = true;
    tmp_prime[0] = tmp_prime[1] = false;

    for (int i = 2; i * i < MAX_NUM; i++)
        if (tmp_prime[i])
            for (int j = 2 * i; j <= MAX_NUM; j += i)
                tmp_prime[j] = false;

    for (int i = 0; i <= MAX_NUM; i++)
        if (tmp_prime[i])
            prime.push_back(i);
    sort(prime.begin(), prime.end());
}

int main()
{
    int m, a, b;

    init_prime();

    while (cin >> m >> a >> b, m || a || b) {
        int p, q;
        int max_pq = 0;

        for (int i = 0; i < prime.size(); i++) 
            for (int j = i; prime[i] * prime[j] <= m; j++) {
                if ((double)a / b > (double)prime[i] / prime[j])
                    break;
                if (prime[i] * prime[j] > max_pq) {
                    max_pq = prime[i] * prime[j];
                    p = prime[i];
                    q = prime[j];
                }
            }

        cout << p << " " << q << endl;
    }

    return 0;
}

