void primeCalc(int **pa,int *pn,int num){
	int i, j;
	int *prime = (int *)malloc(sizeof(int) * (num + 1)), *tmp;
	if(num < 2){
		return;
	}
	memset(prime,-1,sizeof(prime));
	prime[0] = prime[1] = 0;

	for(i = 2;i * i <= num;i++){
		if(prime[i]){
			for(j = i * 2;j <= num;j+=i){
				prime[j] = 0;
			}
		}
	}
	int cnt = 0;
	for(i = 0;i <= num;i++){
		if(prime[i]){
			tmp = (int *)realloc(*pa,sizeof(int) * (cnt + 1));
			*pa = tmp;
			*(*pa + cnt++) = i;
		}
	}
	free(prime);
	*pn = cnt;
}


