		ArrayList<Integer> primes = new ArrayList<Integer>();
		primes.add(2);
		for (int i = 3; i < 100000; i += 2) {
			for (int j = 0; j < primes.size(); ++j) {
				long p = primes.get(j);
				if (p * p > i) {
					primes.add(i);
					break;
				}
				if (i % p == 0) break;
			}
		}
		while (true) {
			int M = sc.nextInt();
