			int A = sc.nextInt();
			int B = sc.nextInt();
			long mp = 0;
			long mq = 0;
			for (int i = 0; i < primes.size(); ++i) {
				long q = primes.get(i);
				if (q * 2 > M) break;
				int pos = Collections.binarySearch(primes, (int) Math.min((M / q), q));
				if (pos < 0) pos = -pos - 2;
				if (pos >= 0) {
					long p = primes.get(pos);
					if (p * q <= mp * mq) continue;
					if (p * B < q * A) continue;
					mp = p;
					mq = q;
				}
			}
			System.out.println(mp + " " + mq);
		}
	}
