/**
 * UnionFindTree 
 * @author yoshikyoto
 */
class UnionFindTree{
	public int[] parent, rank;
	public int n;
	public int count;
	// 初期化
	UnionFindTree(int n){
		this.n = n;
		count = n;
		parent = new int[n];
		rank = new int[n];
		for(int i = 0; i < n; i++){
			parent[i] = i;
			rank[i] = 0;
		}
	}
	// 根を求める
	int find(int x){
		if(parent[x] == x){
			return x;
		}else{
			return parent[x] = find(parent[x]);
		}
	}
	// xとyの集合を結合
	void unite(int x, int y){
		x = find(x);
		y = find(y);
		if(x == y){
			return;
		}
		if(rank[x] < rank[y]){
			parent[x] = y;
			count--;
		}else{
			parent[y] = x;
			if(rank[x] == rank[y]) rank[x]++;
			count--;
		}
	}
	// xとyが同じ集合か
	boolean same(int x, int y){
		return find(x) == find(y);
	}
};


/**
 * 整数を数え上げたりするクラス
 * new Prime(int n) でnまでエラトステネスの篩を実行。
 * @author yoshikyoto
 * @param a[i] iが素数の時true
 * @param count[i] i以下の素数の数
 */
class Prime{
	static boolean[] isPrime;
	static int[] count;
	static ArrayList<Integer> list = new ArrayList<Integer>();

	/**
	 * nまでの計算を行う
	 * @param n
	 */
	static void init(int n){
		isPrime = new boolean[n+1];
		isPrime[0] = false; isPrime[1] = false;
		for(int i = 2; i <= n; i++) isPrime[i] = true;
		// ふるい
		for(int i = 2; i < (n - 3) / 2; i++){
			if(isPrime[i]){
				for(int j = 2; j * i <= n; j++){
					isPrime[j * i] = false;
				}
			}
		}

		// 数え上げと集合の作成
		count = new int[n+1];
		count[0] = 0;
		for(int i = 1; i <= n; i++){
			int gain = 0;
			if(isPrime[i]){
				gain = 1;
				list.add(i);
			}
			count[i] = count[i-1] + gain;
		}
	}
	/**
	 * 入力されたiに対して、素数かどうか判定をして返す
	 * @param i
	 * @return true: 素数である	false: 素数でない
	 */
	static boolean calcPrime(int i){
		if(i <= 1) return false;
		if(i == 2) return true;
		if(i % 2 == 0) return false;
		for(int j = 3; j <= Math.sqrt(i); j+=2){
			if(i % j == 0) return false;
		}
		return true;
	}
}

